import React from "react";


export default class AllListItems extends React.Component{
render()
{ 

    return (
        <div>              
        {this.props.tasks.map(function(task, index){
            return(   
                <div>        
            <div key={index} className='task-wrapper flex-wrapper'>{index+1} - {task.title}  <i className="float-right ">X</i></div>
          
            </div> 
            )
          })}
        </div>  
     )

}
}
